const User = ({ user }) => {
    return (
        <div>
            {user.name} {user.blogs.length} <strong>blogs</strong>
        </div>
    )
}

const Users = ({ users }) => {
    return (
        <div>
            <h2>Users</h2>
            <div>
                {users.map((user) => (
                    <div>
                        {user.name} {user.blogs.length} <strong>blogs</strong>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Users
